import Foundation
class APIManager {
    func sendPostRequest<T : Codable>(urlString: String, bodyParameters: [String: Any], completion: @escaping (Result<T, Error>) -> Void) {
        guard let url = URL(string: urlString) else {
            completion(.failure(APIError.invalidURL))
            return
        }
        
        var request = URLRequest(url: url)
        request.httpMethod = "POST"
        
        do {
            let bodyData = try JSONSerialization.data(withJSONObject: bodyParameters, options: [])
            request.httpBody = bodyData
            request.setValue("application/json", forHTTPHeaderField: "Content-Type")
        } catch {
            completion(.failure(APIError.serializationError))
            return
        }
        
        URLSession.shared.dataTask(with: request) { data, response, error in
            if let error = error {
                completion(.failure(error))
                return
            }
            if let data = data, let result = try? JSONDecoder().decode(ApiResponse<T>.self, from: data) {
                if result.status == 1 {
                    completion(.success(result.data))
                }
                else {
                    completion(.failure(APIError.msg(result.message)))
                }
            } else {
                completion(.failure(APIError.serializationError))
            }
        }.resume()
    }
}
enum APIError: Error {
    case invalidURL
    case serializationError
    case msg(String)
}
struct ApiResponse<T : Codable> : Codable {
    let status : Int
    let message : String
    let data : T
}
struct AudioQuality : Codable {
    let normal : String?
    let high : String?
    let lossless : String?
    enum CodingKeys: String, CodingKey {
        case normal = "128"
        case high = "320"
        case lossless = "lossless"
    }
}
