}

// MARK: - NewRelease
struct NewRelease: Codable {
    let encodeID, title, alias: String
    let isOffical: Bool
    let username: String
    let artistsNames: String
    let artists: [ArtistElement]
    let isWorldWide: Bool
    let thumbnailM: String
    let link: String
    let thumbnail: String
    let duration: Int
    let zingChoice, isPrivate, preRelease: Bool
    let releaseDate: Int
    let genreIDS: [String]
    let album: Album
    let distributor: String
    let indicators: [String]
    let isIndie: Bool
    let streamingStatus: Int
    let allowAudioAds: Bool
    let hasLyric: Bool?
    let rakingStatus, score, totalTopZing: Int?
    let artist: PurpleArtist?
    let mvlink: String?
    let downloadPrivileges, streamPrivileges: [Int]?

    enum CodingKeys: String, CodingKey {
        case encodeID = "encodeId"
        case title, alias, isOffical, username, artistsNames, artists, isWorldWide, thumbnailM, link, thumbnail, duration, zingChoice, isPrivate, preRelease, releaseDate
        case genreIDS = "genreIds"
        case album, distributor, indicators, isIndie, streamingStatus, allowAudioAds, hasLyric, rakingStatus, score, totalTopZing, artist, mvlink, downloadPrivileges, streamPrivileges
    }
}

